const Toolbar: React.FunctionComponent = (): JSX.Element => {
    const toolbarContext: IToolbar = React.useContext(ToolbarContext)
    console.log(toolbarContext.show)

    return (
        <div className={css.Toolbar}>

        </div>
    )
}

export default Toolbar
